import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import './styles.css'

function App() {
  return (
    <Router>
      <div className="wrapper">
        <Switch>
          <Route exact path="/">
            <Login />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
